var liType = [],
    liType2 = [],
    tnum = 4, //the number of the type shown on one list 
    Ppadding = Twidth / tnum,
    Ppadding2 = svgHeight /tnum,
    i = 0;

var TTheight = (svgHeight - margin.top*4) / 3,
    margin3 = { top: 10, left: 10},
    halfSpace2 = 20;
//color
var tencolor = "#7DB9DE",
    alicolor = "#DC9FB4",
    axistext = "#fff";

var Alldata = data.map(d => ({ data: d, index: d.id })).sort((a, b) => a.index - b.index);

var yScale = d3.scaleLinear()
    .domain(d3.extent(data, d => d.year))
    .range([margin.top, height]);
var xScale = d3.scaleLinear()
    .domain(d3.extent(data, d => d.year))
    .range([margin.left, width - margin.right]);

const yAxis = g => g
    .attr("transform", `translate(${margin2.left},${svgHeight - margin.bottom})`)
    .call(d3.axisTop(xScale).tickSizeOuter(0).tickFormat(d3.format("")));

const xAxis = g => g
    .attr("transform", `translate(${margin2.left + svgWidth / 2},${margin.top})`)
    .call(d3.axisLeft(yScale).tickSizeOuter(0).tickFormat(d3.format("")));

function compute(){   
    //一.compute the simple position 
    const simcir0 = data.map(d => ({ m: xScale(d.year), data: d, index: d.id })).sort((a, b) => a.m - b.m);
    const simcir = data.map(d => ({ m: yScale(d.year), data: d, index: d.id })).sort((a, b) => a.m - b.m);
    simpos(simcir0, height);

    for (c = 0; c < simcir0.length; c++) {
        const x = simcir0[c].m;
        const y = simcir0[c].n;
        const i = simcir0[c].index;

        for (d = 0; d < Alldata.length; d++) {
            if (Alldata[d].index === i) {
                Alldata[d].x1 = x;
                Alldata[d].y1 = y;
            }
        }
    };

    //二.compute t&a position data
    tencir = simcir.filter(function (d) { return d.data.inname === "腾讯" });
    alicir = simcir.filter(function (d) { return d.data.inname === "阿里" });

    simpos(tencir, width /2);
    simpos(alicir, (width - halfSpace) / 2);

    for (c = 0; c < tencir.length; c++) {
        const x = tencir[c].n;
        const y = tencir[c].m;
        const i = tencir[c].index;

        for (d = 0; d < Alldata.length; d++) {
            if (Alldata[d].index === i) {
                Alldata[d].x2 = x;
                Alldata[d].y2 = y;
            }
        }
    };

    for (c = 0; c < alicir.length; c++) {
        const x = alicir[c].n;
        const y = alicir[c].m;
        const i = alicir[c].index;

        for (d = 0; d < Alldata.length; d++) {
            if (Alldata[d].index === i) {
                Alldata[d].x2 = x;
                Alldata[d].y2 = y;
            }
        }
    };
    //三.compute type position data
    liType = ["文化娱乐", "电子商务", "企业服务", "汽车交通", "本地生活", "金融", "游戏", "医疗健康", "工具软件", "教育", "物流", "社交网络", "硬件", "旅游", "房产服务", "体育运动", "广告营销","农业",""]
    for (t = 0; t < liType.length; t++){   
        //1.filter data by type
        var sdata = data.filter(function (d) { return d.type === liType[t]});

        //2.compute every data's (x,y) by pack method
        var circles = d3.packSiblings(sdata
            .map(function(d){ return {data: d, index: d.id, r: radius + Tpadding};}));
        console.log("c:");
        console.log(circles);

        //3.translate the meta data
        var ncircles = circles.map(d => cpost(d, i));
        // console.log(ncircles);

        //4.match tdata to the Alldata 
        for (c = 0; c < ncircles.length; c++) {
            const x = ncircles[c].x;
            const y = ncircles[c].y;
            const id = ncircles[c].index;

            for (d = 0; d < Alldata.length; d++) {
                if (Alldata[d].index === id) {
                    Alldata[d].x3 = x;
                    Alldata[d].y3= y;
                }
            }
        };
        //5.end and recircle
        i = i+1;
        // console.log(i);

        function cpost(d, i){
            // console.log(i, tnum);
            if( i<tnum ){
                d.x = d.x + i * Ppadding
            }
            else if( i >= tnum && i < tnum*2){
                d.x = d.x + (i-tnum) * Ppadding;
                d.y = d.y + Ppadding2 *1.1
            } else if (i >= tnum * 2 && i < tnum * 3) {
                d.x = d.x + (i - tnum*2) * Ppadding;
                d.y = d.y + Ppadding2 * 1.9
            }
            else if (i >= tnum * 3 && i < tnum * 4) {
                d.x = d.x + (i - tnum * 3) * Ppadding;
                d.y = d.y + Ppadding2 * 2.6
            }
            else if (i >= tnum * 4 && i < tnum * 5) {
                // d.x = d.x + (i - tnum * 4) * Ppadding;
                // d.y = d.y + Ppadding2 * 3.3
                d.x = 800 + Math.random()*100;
                d.y = 800 + Math.random() * 100;
            }
            return d;
        };
        
    };
    //四.compute type&time position data 
    liType2 = ["文化娱乐", "电子商务", "本地生活"];

    const simcir2 = data.filter(function (d) { return d.year > 2009 && d.year < 2018 });
    var TyScale = d3.scaleLinear()
        .domain(d3.extent(simcir2, d => d.year))
        .range([svgWidth - Twidth - margin.left, width - margin.right]);
    simcir3 = simcir2.map(d => ({ m: TyScale(d.year), data: d, index: d.id })).sort((a, b) => a.index - b.index);

    for(l = 0; l < liType2.length; l++){
        sdata = simcir3.filter(function(d){return d.data.type === liType2[l]});
        stendata = sdata.filter(function (d) { return d.data.inname === "腾讯" });
        salidata = sdata.filter(function (d) { return d.data.inname === "阿里" });
        simpos(stendata, TTheight / 2 - margin3.top);
        simpos(salidata, TTheight / 2 - margin3.top);
        const li = (TTheight + margin.top) * l;
        for(s = 0; s < stendata.length; s++){
            const x = stendata[s].m;
            const y = TTheight/2 - stendata[s].n - margin3.top - halfSpace2/2 + li;
            const i = stendata[s].index;

            for (d = 0; d < Alldata.length; d++) {
                if (Alldata[d].index === i) {
                    Alldata[d].x4 = x;
                    Alldata[d].y4 = y;
                }
            }
        };
        for (s = 0; s < salidata.length; s++) {
            const x = salidata[s].m;
            const y = TTheight/2 + salidata[s].n + margin3.top + halfSpace2/2 + li;
            const i = salidata[s].index;

            for (d = 0; d < Alldata.length; d++) {
                if (Alldata[d].index === i) {
                    Alldata[d].x4 = x;
                    Alldata[d].y4 = y;
                }
            }
        };
    };

 
    //common function
    function simpos(data, edge) {
        const epsilon = 1e-3;
        let head = null, tail = null;
        // Place each circle sequentially.
        for (const b of data) {

            // Remove data from the queue that can’t intersect the new circle b.
            while (head && head.m < b.m - (radius * 2 + padding)) head = head.next;

            // Choose the minimum non-intersecting tangent.
            if (intersects(b.m, b.n = 0)) {
                let a = head;
                b.n = Infinity;
                do {
                    let n = a.n + Math.sqrt((radius * 2 + padding) ** 2 - (a.m - b.m) ** 2);
                    if (n < b.n && !intersects(b.m, n)) b.n = n;
                    
                    a = a.next;
                } while (a);
            };
            // Add b to the queue.
            b.next = null;
            if (head === null) head = tail = b;
            else tail = tail.next = b;
        }
        // Returns true if circle ⟨m,n⟩ intersects with any circle in the queue.
        function intersects(m, n) {
            let a = head;
            while (a) {
                if ((radius * 2 + padding - epsilon) ** 2 > (a.m - m) ** 2 + (a.n - n) ** 2) {
                    return true;
                }
                a = a.next;
            }
            return false;
        }
        for (b of data){
            if (b.n > edge && b.n < edge * 2) {
                b.m = b.m + radius * 2 + padding;
                b.n = b.n - edge -padding/2;
            } else if (b.n > edge*2 && b.n < edge*3){
                b.m = b.m + radius * 4 + padding*2;
                b.n = b.n - edge * 2 - padding;
            } else if (b.n > edge * 3 && b.n < edge * 4) {
                b.m = b.m + radius * 6 + padding * 3;
                b.n = b.n - edge * 3 - padding;
            } else if (b.n > edge * 4 && b.n < edge * 5) {
                b.m = b.m + radius * 8 + padding * 4;
                b.n = b.n - edge * 4 - padding*2;
            }  else if (b.n > edge * 5 && b.n < edge * 6) {
                b.m = b.m + radius * 10 + padding * 5;
                b.n = b.n - edge * 5 - padding*2;
            }  
        }
        return data;
    };  
};

var Circles, svg, firstL, drawingArea, axisContainer, circleContainer, tooltip;
var Tlogo, Ttext, Timg, Ttext1, Ttext2, Ttext3, Ttext4;

function initlayout(){
    svg = d3.select("svg")
        .attr("width", svgWidth)
        .attr("height", svgHeight);

    drawingArea = svg.append("g")
        .classed("drawingArea", true);

    axisContainer = drawingArea.append("g").attr("id", "axis-container");
    circleContainer = drawingArea.append("g").attr("id", "circle-container")
                        .attr("width", width)
                        .attr("height", height)
        .attr("transform", `translate(${margin2.left}, ${margin2.top})`);

    tooltip = d3.select("body").append("div")
        .attr("class", "tooltip")
        .style("opacity", 0);
    // add tooltip style
    Tlogo = tooltip.append("div");
    Ttext = tooltip.append("div");
    Timg = Tlogo.append("img");
    Ttext1 = Ttext.append("p");
    Ttext2 = Ttext.append("p");
    Ttext3 = Ttext.append("p"); 
    Ttext4 = Ttext.append("p");

};
function preL(){
    Circles = circleContainer.selectAll("circle")
        .data(Alldata)
        .enter()
        .append("g")
        .append("circle")
        .attr("r", radius)
        .attr("fill", function (d) {
            if (d.data.inname === "腾讯") {
                return tencolor
            } else {
                return alicolor
            }
        })
        .style("opacity", 0)
        .attr("cx", d => d.x1)//random algorithm
        .attr("cy", d => height - d.y1 - 100);
    //draw tooltip
    d3.selectAll("circle")
        .on("mouseover", function(d){
            tooltip.transition()
                .duration(1000)
                .style("opacity", 1);
            tooltip
                .style("left", (d3.event.pageX - 60) + "px")
                .style("top", (d3.event.pageY - 40) + "px");

            Tlogo.attr("class", "logo");
            Ttext.attr("class", "Ttext");
            Timg.attr("src", d.data.logo_url).attr("height", "100%");
            Ttext1.attr("class", "Tptext").html(d.data.name);
            Ttext2.attr("class", "Tptext").html(d.data.inname);
            Ttext3.attr("class", "Tptext").html(d.data.type);
            Ttext4.attr("class", "Tttext").html(d.data.date);

            
        })
        .on("mouseout", function (d) {
            tooltip.transition()
                .duration(0)
                .style("opacity", 0)
            Tlogo.attr("class", "");
            Ttext.attr("class", "");
            d3.selectAll(".Tptext").attr("class", "");
        })
};
